    <title>fibanacci</title>
</head>
<body>
    <script>
        var prime;
        for (var count = 5; count <= 100; count++) {
 
 var Prime = false;
 for (var i = 2; i <= count; i++) {
     if (count % i === 0 && i!==count) {
         Prime = true;
         
     }
 }
 if (Prime === false) {
             document.write(count +'</br>');
 }
 } 
 </script>
</body>
